function sendReportString(string, size){
	let packet= [];
	let data = string.split(' ');

	for(let i = 0; i < data.length; i++){
		packet[parseInt(i, 16)] = parseInt(data[i], 16);//.toString(16)
	}

	device.send_report(packet, size);
}

