function hexToRgb(hex) {
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}

export function Shutdown() {
	sendColors(true);
}

export function Validate(endpoint) {
	return endpoint.interface === 1  && endpoint.usage === 0x0001 && endpoint.usage_page == 0xff01;
}

function sendColors(shutdown = false){
	let packet = [];
	packet[0x00]   = 0x07;
	packet[0x01]   = 0x14;
	packet[0x02]   = 0x00;
	packet[0x03]   = 0x0A;
	packet[0x04]   = 0x00;
	packet[0x05]   = 0x00;
	packet[0x06]   = 0x00;
	packet[0x07]   = 0x00;

	let red = new Array(32).fill(0);
	let green = new Array(32).fill(0);
	let blue = new Array(32).fill(0);

	for(let iIdx = 0; iIdx < vLed.length; iIdx++) {
		let iPxX = vLedPositions[iIdx][0];
		let iPxY = vLedPositions[iIdx][1];
		var color;

		if(shutdown){
			color = hexToRgb(shutdownColor);
		}else if (LightingMode === "Forced") {
			color = hexToRgb(forcedColor);
		}else{
			color = device.color(iPxX, iPxY);
		}


		red[vLed[iIdx]] = color[0];
		green[vLed[iIdx]] =  color[1];
		blue[vLed[iIdx]] =  color[2];
	}


	packet = packet.concat(red.splice(0, 32));
	packet = packet.concat(green.splice(0, 32));
	packet = packet.concat(blue.splice(0, 32));

	packet[108] = red[0];
	packet[109] = green[0];
	packet[110] = blue[0];

	device.send_report(packet, 264);
	device.pause(1);
}

export function Render() {
	sendColors();

	if(savedDpi1 != dpi1 && DpiControl){
		setDpi(dpi1);
	}
}


